import React from 'react';


const HistoryNav = () => {

    return (
        <div> 
            <div id='first-dropdown'> 
                <select>
                    <option value='a'></option>
                    <option value='b'></option>
                    <option value='c'></option>
                    <option value='d'></option>
                </select>
            </div>
        </div>
    )
    
}

export default HistoryNav;
